(16, 'Aliquam laudantium aut asperiores porro autem et ullam est nostrum assumenda eveniet', NULL, 'Est est deleniti atque unde itaque ipsam dolor voluptatum nesciunt adipisci nisi soluta quibusdam in impedit ducimus est quam reprehenderit facilis dolorem sint esse ad quia odit maiores vel saepe ut sint beatae natus accusantium repudiandae nulla eos explicabo id aut ut libero commodi asperiores amet iure nam recusandae totam optio rerum quia dolorum ratione fugit ut voluptatem dolores minima quis a consequatur aut tempora vel cupiditate blanditiis voluptatem veritatis quia voluptatem et non odio dignissimos voluptates ab cum dolores dicta fuga et et et sunt perferendis laboriosam doloribus laudantium incidunt neque aperiam sed et et quo rerum velit molestiae facere.Doloribus et voluptates fugiat saepe doloremque reprehenderit modi non laudantium vitae et sit asperiores sint animi quae vel eos totam officiis facere voluptatem excepturi exercitationem id est explicabo tenetur voluptatibus iste quis aut neque est molestias et eaque hic dicta omnis corrupti incidunt minus dolorem esse quos nemo non eos ipsam adipisci minima ipsum ea ex quod non dolores laborum tempora dolorum aut rerum nihil ut et sunt a quidem libero architecto aliquam nesciunt numquam consequatur magni debitis eligendi rerum dignissimos ut repellat nisi repellendus sequi laboriosam culpa ab id sit amet qui et atque blanditiis dolore vero nam consequatur quam consectetur et sed.', NULL, 1, 3, 1, '2010-02-12', '2012-05-29 00:44:37', '2012-05-29 00:44:37', 'image1.jpg', 'image/jpeg', 18153, '2012-05-29 00:44:37'),
