(92, 'Corrupti suscipit dolorum voluptas aliquam nemo et repellat delectus et reiciendis quidem quasi ea voluptas', 'Qui sed deserunt', 'Qui consequatur velit veniam quidem et maiores aut odit voluptate et expedita vitae provident temporibus pariatur ipsam sunt animi consequuntur labore quia quos impedit autem ut voluptatibus unde et est iure molestiae quis voluptatem quam et qui id enim earum sint accusantium molestias aspernatur dolores fugiat deserunt consectetur natus non illo odio sunt ab dignissimos ullam sed aut laboriosam quisquam numquam vel perferendis sed quae alias quia est quod voluptas ipsa omnis quo aliquid doloribus repellendus hic aperiam atque corrupti rerum dolore in sit suscipit ut magnam sapiente blanditiis enim magni iusto placeat tempora voluptatem aut mollitia rem accusamus veritatis cupiditate.Rerum officiis incidunt eaque molestiae consequatur dicta et autem libero amet explicabo eveniet qui qui reiciendis earum fugit voluptatem similique aut tempora quia aut vel id quo provident eligendi temporibus adipisci qui aliquam ad velit eos sequi ipsa dignissimos nesciunt enim quis eum ipsum quasi doloremque omnis modi omnis voluptatum vero placeat est delectus deserunt cumque voluptas quia accusamus nostrum ullam aspernatur reprehenderit molestias labore mollitia aut tempore eos omnis et ea sint iste eius voluptatibus optio dolor maxime qui id aut repellendus quis laboriosam rerum impedit esse consectetur hic est fuga aut non enim facilis ab architecto odio ut nam autem unde itaque facere.', NULL, 1, 3, 4, '2010-05-14', '2012-05-29 00:44:57', '2012-05-29 00:44:57', 'image1.jpg', 'image/jpeg', 18153, '2012-05-29 00:44:57'),
